import React, { useEffect, useState } from 'react';
import { postDeleteCliente, getClientes } from '../../Utils/Cliente';
import DetailCliente from "./DetailCliente";

import CreateTable from '../Partials/CreateTable';
import DetailVehiculo from './DetailVehiculo';
import { getVehiculos, postDeleteVehiculo } from '../../Utils/Vehiculo';

export default function VehiculoTablActivos(props) {
    const { table, id, vocabulary, changeFrame } = props;
    return (
        <CreateTable
            fetchGet={getClientes}
            fetchDelete={postDeleteCliente}
            title="Clientes"
            DetailComponent={DetailCliente}
            changeFrame={changeFrame}
            id={id}
            table={table}
            vocabulary={vocabulary} />
    );
};

const id = "telefono";

const table =
    [
        { column: "Nombre", filter: ["nombre"], row: ["nombre"] },
        { column: "Apellido", filter: ["apellido"], row: ["apellido"] },
        { column: "Mail", filter: ["mail"], row: ["mail"] },
        { column: "Telefono", filter: ["telefono"], row: ["telefono"] },
        { column: "Direccion", filter: ["direccion"], row: ["direccion"] },
        { column: "Ultima visita", filter: ["ultima_visita"], row: ["ultima_visita"] }
    ];

const vocabulary = {
    singular: "cliente",
    id: ["telefono"],
    pronombre: "el"
};
